Tips for purchasing loofah in summer
Straight and evenly: The melon body is straight, with uniform thickness and thickness, and a diameter of about 3 cm. This kind of loofah is well developed;
Moderate soft and hardness: moderate soft and hardness have sufficient moisture and fresher; particularly hard loofahs will be bitter, so don’t choose;
Tender green color: the loofah with tender green color and clear patterns is just ripe and has a tender taste;
The melon handle is crispy: the melon handle does not wither and can be pinched with your hands;
Fresh flowers: Luffa flowers that do not wither are fresher.
